{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/husadahertzsprung/a-b-testing-for-side-positional-role-in-3412?scriptVersionId=104198271\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"704fd5cb","metadata":{"execution":{"iopub.execute_input":"2022-03-23T16:37:30.518536Z","iopub.status.busy":"2022-03-23T16:37:30.48271Z","iopub.status.idle":"2022-03-23T16:37:30.549273Z"},"papermill":{"duration":0.108328,"end_time":"2022-08-25T17:15:31.689856","exception":false,"start_time":"2022-08-25T17:15:31.581528","status":"completed"},"tags":[]},"source":["# 3412 Musings\n","\n","## Atalanta Bergamasca Calcio S.p.A.\n","Gasperini shaped Atalanta into a goal machine. In one of its many shapes, their 3412 formation strike fear into their enemy's hearts. With its 2 diamonds at the side and 1 bridging pivot in the midle, Atalanta overwhelmed their foes with relentless pressing, direct onslaught, and massive overload. From the 2018/2019 season to 2020/2021 season, Atalanta wrecked the Serie A with their goal bombarding prowess as the team with most goal scored for 3 consecutive seasons. It was such an incredible feat since Atalanta football club was not a giant club; it's a glorious underdog uprising. \n","\n","## Football Manager Adaptation\n","Despite all that words I wrote, it's pretty rare for me to actually watch football. I had subscribed to some service in order to watch Premier League and Bundes Liga for a season but that was that. Nevertheless, reading and watching about the tactics and movements of Gasperini's monstrous disruption was fascinating, so I adopted his football philosophy into my Football Manager campaign. \n","\n","## Problem with the Side Positional Role\n","I've seen several attempts to replicate Atalanta's Gasperini 3412, and many of its various aspects are somewhat agreeable since they would eventually need to be adjusted according to situations. But there is a bit of problem when it comes to decide whether to use mid level side role that aligned with midfielders, or lower level side role that aligned with wing backs. In solo campaign, I mainly use the mid level side role such as Wide Midfielder. But natural Wide Midfielders are rare. Most players playing at the mid-side level are Wingers or Inverted  Wingers. But this can be treated in solo games via retraining, in my current save with AS ROMA, I retrain Renato Sanches into left Wide Midfielder and Harvey Elliot into Right Midfielder. However, when it comes to playing against other humans in Fantasy Draft, this can be a problem. \n","\n","## Consideration for Fantasy Draft\n","Recently, I entered a Football Manager competition and found myself worried about what Wide Midfielders to pick for the draft. Considering WM's rarity and the competition's budget restriction, I need to alter my favorite tactic. It's either to switch to Wing Back or Complete Wing Back. In the experiment I did using the Fantasy Draft feature bellow, I observed some differences in the results, but is it significant? Statistically significant? Scientifically significant? Football Managery significant? Let's find out."]},{"cell_type":"markdown","id":"f08b5564","metadata":{"execution":{"iopub.execute_input":"2022-03-24T02:49:11.130054Z","iopub.status.busy":"2022-03-24T02:49:11.097226Z","iopub.status.idle":"2022-03-24T02:49:11.164428Z"},"papermill":{"duration":0.084381,"end_time":"2022-08-25T17:15:31.862163","exception":false,"start_time":"2022-08-25T17:15:31.777782","status":"completed"},"tags":[]},"source":["### **The General Simulation Procedure**\n","1. Set up budget proportions for main, sub, and extra sub players with the total budget limitation \n","2. Set up filter for attributes according to football style prefered\n","3. In the draft, apply the attribute filter and budget filter, and pick the top player that shows up, descendingly arranged by transfer value\n","---\n","\n","### *The Specific Simulation Procedure*\n","In this particular case, I set up the squad with 390 millions Pounds sterling limitation splitted into: \n","- 300 millions for 11 regular starters, adjusted to 27 millions each\n","- 75 millions for 11 substitution players, adjusted to 7 millions each\n","- 15 million for 3 back up substitution players, 5 millions each\n","\n","The attributes filter I chose were, at least 5 out of 7 match of at least 12 points in: \n","- Aggression\n","- Anticipation\n","- Determination\n","- Teamwork\n","- Workrate\n","- Acceleration\n","- Stamina\n","\n","As an additional information, here was the setting for fantasy draft where the simulation was played:\n","- World Pool Player\n","- League Format\n","- 390m Pounds sterling squad budget\n","- 22.3.0 database version\n","- 5 minutes shortlist & 5 minutes draft round time limit\n","- Obligated to pick 3 goal keepers\n","- Minimum of 19 players\n","- Add AI manager, auto select up to the total of 19 club in the draft. \n","\n","##### First I ran 10 simulation according to the above procedure with mid level side role that aligned with midfielders as Wide Midfielder. Then, I redo the draft, but now when I picked the side player, I chose the lower level side role that aligned with wing backs, then I ran 10 simulation with Wing Back as the chosen role. Without redoing another draft, I continued with the same team, by only changing the side role players into Complete Wing Back for another 10 simulation.\n","\n","**The difference of players between the two draft, are only slightly, since the ony randomization factor was influenced by how some the players were removed from the pool because it was already picked by the other 18 AI managers in the drafting process**"]},{"cell_type":"code","execution_count":1,"id":"91f8d02e","metadata":{"execution":{"iopub.execute_input":"2022-08-25T17:15:32.056045Z","iopub.s