ourselves of the in game description of the three roles.\n","\n","**Wide Midfielder on Attack duty**: *The Wide Midfielder performs defensive and attacking duties on the flanks, supporting the forwards, midfield and defence when required. Generally lacking either the explosive pace or exciting dribbling skills of an out-and-out Winger, the Wide Midfielder relies on teamwork and work rate to get into dangerous attacking positions without compromising his defensive responsibilities. With an Attack duty, the Wide Midfielder looks to play quick crosses in from the final third.*\n","\n","**Wing Back on Attack duty**: *Usually playing out wide with no wing support, the Wing Back must fulfill all the attacking and defensive duties of wingers and full-backs. In attack he must be prepared to run at his man and put in aggressive crosses, in midfield to help win the possession battle and in defence to close down opponents, block crosses and win back the ball when possible. With an Attack duty, the Wing-Back aims to overlap down the flank to provide wide support for attacks, run at his man and get crosses in from the byline.*\n","\n","**Complete Wing Back on Attack duty**: *The Complete Wing Back loves to attack, and while he is capable of occupying his defensive duties, his natural inclination is to affect the game in the opposisiton's defensive third by roaming from his position. With an Attack duty, the Complete Wing-Back will be a little more adventurous in his attacking exploits as he seeks to primarily impact the game in the opposition's half of the pitch.*\n","\n"]},{"cell_type":"code","execution_count":5,"id":"145ecfe5","metadata":{"execution":{"iopub.execute_input":"2022-08-25T17:22:05.737117Z","iopub.status.busy":"2022-08-25T17:22:05.735022Z","iopub.status.idle":"2022-08-25T17:22:06.268318Z","shell.execute_reply":"2022-08-25T17:22:06.267071Z"},"papermill":{"duration":0.655608,"end_time":"2022-08-25T17:22:06.268462","exception":false,"start_time":"2022-08-25T17:22:05.6