 1\n","20. 14.5\n","\n","\n"],"text/plain":[" [1] 14.0  1.5 10.5  2.5  0.0 11.0  9.5 13.5 12.5 12.0  0.5 14.0 10.5  2.5  1.5\n","[16] 13.0 17.0  1.5  1.0 14.5"]},"metadata":{},"output_type":"display_data"}],"source":["# preparing for the permutation test\n","# the number of permutation samples to take\n","P <- 100000 \n","\n","# initialize a matrix to store the permutation data\n","perm_matrix <- matrix(0, nrow=n, ncol=P)\n","\n","# assuming null hypothesis is true, we sample from the whole data\n","for(i in 1:P){\n","  perm_matrix[,i] <- sample(variable, size=n, replace=FALSE)\n","}\n","\n","# check the dimension\n","dim(perm_matrix)\n","\n","# initialize vectors to store all of the Test-stats:\n","perm_test_abs_med_diff  <- rep(0, P)\n","\n","# test absolute median just like in bootstrap hypothesis testing \n","\n","for (i in 1:P){\n","  # calculate the perm-test-stat1 and save it\n","  perm_test_abs_med_diff[i] <- abs(median(perm_matrix[data$side_role==\"WM AT\",i]) - \n","                               median(perm_matrix[data$side_role==\"CWB AT\",i]))\n","}\n","\n","# check the length and preview the value\n","length(perm_test_abs_med_diff)\n","perm_test_abs_med_diff[1:20]"]},{"cell_type":"code","execution_count":15,"id":"b6947f40","metadata":{"execution":{"iopub.execute_input":"2022-08-25T17:22:21.570527Z","iopub.status.busy":"2022-08-25T17:22:21.568555Z","iopub.status.idle":"2022-08-25T17:22:21.667211Z","shell.execute_reply":"2022-08-25T17:22:21.666072Z"},"papermill":{"duration":0.249019,"end_time":"2022-08-25T17:22:21.667354","exception":false,"start_time":"2022-08-25T17:22:21.418335","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT9f/H8U+S7r0ohZayZFSGIBQQlCXbMhREZAgoLpaAKIgo4EBwUAegoCiI\nAoLCTzZ8VVSQgoDsJVtGWaUUutvkfn8kTUObppc0ozmej7/Sy+fu3jfzanJ3H5UkSQIAAADu\nT+3qAgAAAGAfBDsAAACFINgBAAAoBMEOAABAIQh2AAAACkGwAwAAUAiCHQAAgEIQ7AAAABSC\nYAcAAKAQBDsAAACFIN